import React, { Component } from 'react';
import phones from "./dataPhone.json";
export default class BTPhone extends Component {
  render() {
    return (
      <div>
        <div className="row">
            {phones.map((phone)=>{
                <div className="card">
                    <img src={phone.hinhAnh} alt={phone.tenSP} />
                    <div className="card-body">
                        <h2>{phone.tenSP}</h2>
                        <button className=''></button>
                    </div>
                </div>
            })}
        </div>
      </div>
    )
  }
}
